DROP TABLE IF EXISTS "public"."adm_charge_item_definition";
CREATE TABLE "public"."adm_charge_item_definition" (
  "id" int8 NOT NULL DEFAULT nextval('adm_charge_item_definition_id_seq'::regclass),
