  "instance_table" varchar(255) COLLATE "pg_catalog"."default" NOT NULL DEFAULT ''::character varying,
  "instance_id" int8 NOT NULL,
  "effective_start" timestamptz(6),
  "effective_end" timestamptz(6),
  "type_code" varchar(255) COLLATE "pg_catalog"."default" NOT NULL DEFAULT ''::character varying,
  "yb_type" varchar(32) COLLATE "pg_catalog"."default" NOT NULL DEFAULT 0,
  "condition_flag" int4 NOT NULL DEFAULT 0,
  "price" numeric(20,6) NOT NULL DEFAULT 0,
  "tenant_id" int8 NOT NULL,
  "delete_flag" char(1) COLLATE "pg_catalog"."default" NOT NULL DEFAULT 0,
  "create_by" varchar(32) COLLATE "pg_catalog"."default" NOT NULL DEFAULT ''::character varying,
  "create_time" timestamptz(6) NOT NULL,
  "update_by" varchar(32) COLLATE "pg_catalog"."default",
  "update_time" timestamptz(6)
)
;
COMMENT ON COLUMN "public"."adm_charge_item_definition"."id" IS 'ID';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."charge_name" IS '名称';
