COMMENT ON COLUMN "public"."adm_charge_item_definition"."effective_start" IS '有效时间开始';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."effective_end" IS '有效时间结束';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."type_code" IS '财务类别';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."yb_type" IS '医保类别';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."condition_flag" IS '是否使用详细价格规则';
