COMMENT ON COLUMN "public"."adm_charge_item_definition"."tenant_id" IS '租户ID';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."delete_flag" IS '删除状态';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."create_by" IS '创建人';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."adm_charge_item_definition"."update_by" IS '更新人';
