  "id" int8 NOT NULL DEFAULT nextval('cli_condition_id_seq'::regclass),
  "verification_status_enum" int4,
  "clinical_status_enum" int4,
  "category_enum" int4 DEFAULT 2,
  "severity_enum" int4,
  "bus_no" varchar(255) COLLATE "pg_catalog"."default",
  "body_site_json" varchar(2000) COLLATE "pg_catalog"."default",
  "body_structure_id" int8,
  "patient_id" int8 NOT NULL,
  "description" varchar(255) COLLATE "pg_catalog"."default",
  "onset_datetime" timestamptz(6),
  "onset_age" int4,
  "onset_text" varchar(2000) COLLATE "pg_catalog"."default",
  "abatement_datetime" timestamptz(6),
  "abatement_age" int4,
  "abatement_string" varchar(255) COLLATE "pg_catalog"."default",
  "recorded_datetime" timestamptz(6),
  "recorder_id" int8,
  "stage_summary_text" varchar(2000) COLLATE "pg_catalog"."default",
  "evidence" varchar(255) COLLATE "pg_catalog"."default",
  "yb_no" varchar(255) COLLATE "pg_catalog"."default",
  "tenant_id" int8 NOT NULL,
  "delete_flag" char(1) COLLATE "pg_catalog"."default" NOT NULL DEFAULT 0,
  "create_by" varchar(32) COLLATE "pg_catalog"."default" NOT NULL DEFAULT ''::character varying,
  "create_time" timestamptz(6) NOT NULL,
  "update_by" varchar(32) COLLATE "pg_catalog"."default",
  "update_time" timestamptz(6),
  "definition_id" int8
)
;
COMMENT ON COLUMN "public"."cli_condition"."id" IS 'ID';
COMMENT ON COLUMN "public"."cli_condition"."verification_status_enum" IS '验证状态';
