  "update_by" int8,
  "status" int2,
  "remark" varchar(255) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."sys_expression"."id" IS '表单主键';
COMMENT ON COLUMN "public"."sys_expression"."name" IS '表达式名称';
COMMENT ON COLUMN "public"."sys_expression"."expression" IS '表达式内容';
COMMENT ON COLUMN "public"."sys_expression"."data_type" IS '表达式类型';
COMMENT ON COLUMN "public"."sys_expression"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."sys_expression"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."sys_expression"."create_by" IS '创建人员';
COMMENT ON COLUMN "public"."sys_expression"."update_by" IS '更新人员';
COMMENT ON COLUMN "public"."sys_expression"."status" IS '状态';
COMMENT ON COLUMN "public"."sys_expression"."remark" IS '备注';
