COMMENT ON COLUMN "public"."sys_listener"."value_type" IS '值类型';
COMMENT ON COLUMN "public"."sys_listener"."value" IS '执行内容';
COMMENT ON COLUMN "public"."sys_listener"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."sys_listener"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."sys_listener"."create_by" IS '创建人员';
COMMENT ON COLUMN "public"."sys_listener"."update_by" IS '更新人员';
COMMENT ON COLUMN "public"."sys_listener"."status" IS '状态';
COMMENT ON COLUMN "public"."sys_listener"."remark" IS '备注';
COMMENT ON TABLE "public"."sys_listener" IS '流程监听';

